canvasObject.clipTo:
function (ctx) {
	      var cw,
	          ch,
	          mw,
	          mh,
	          msx,
	          msy;
	      cw = ctx.canvas.width;
	      ch = ctx.canvas.height;
	      mw = area.width * shape.scaleX;
	      mh = area.height * shape.scaleY;
	      msx = area.offsetX * shape.scaleX;
	      msy = area.offsetY * shape.scaleY;
	      ctx.save();
	      ctx.setTransform(1, 0, 0, 1, cw / 2 + msx, ch / 2 + msy);
	      ctx.rect(0, 0, mw, mh);
	      ctx.restore();
	    }
